import React from "react";
import "./style.css";
import ImgArray from './ImgArray';


// {ImgArray.map(({id, src, title, description}) => <img key={id} src={src} title={title} alt={description} />)

function Images(props) {
  console.log(ImgArray)
  return (
    <div>
      {props.ImgArray[0].map(({id, src, title, description}) => 
      <img key={id} src={src} title={title} alt={description}></img>)}

    </div>
  );
}

export default Images;
